script: |
  super -f text -I q3596.spq | sort > q3596.out

inputs:
  - name: q3596.spq
    data: |
      SELECT ALL - col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col0 * col1 / CAST ( + - col0 AS INTEGER ) / + - col0 + + 80 + col1 IS NOT NULL;
  - name: tab0

outputs:
  - name: q3596.out
    data: |
